import * as React from 'react';
import * as ssh2 from 'ssh2';

export default function SftpViewer() {
  const [files, setFiles] = React.useState<string[]>([]);

  React.useEffect(() => {
    const conn = new ssh2.Client();

    conn.on('ready', () => {
      console.log('Client :: ready');
      conn.sftp((err, sftp) => {
        if (err) throw err;
        console.log('SFTP session :: ready');
        sftp.readdir('/', (err, list) => {
          if (err) throw err;
          console.dir(list);
          setFiles(list.map((file) => file.filename));
          conn.end();
        });
      });
    });

    conn.connect({
      host: 'localhost',
      port: 22,
      username: 'username',
      password: 'password'
    });

    return () => {
      conn.end();
    };
  }, []);

  return (
    <div>
      <h1>SFTP Files:</h1>
      <ul>
        {files.map((file) => (
          <li key={file}>{file}</li>
        ))}
      </ul>
    </div>
  );
}
